CREATE TABLE IF NOT EXISTS `tdatasession` (
  `id` INTEGER PRIMARY KEY,
  `IdDataSession` INTEGER DEFAULT NULL,
  `Time` INTEGER DEFAULT NULL,
  `HR` REAL DEFAULT NULL,
  `SpO2` REAL DEFAULT NULL,
  `O2` REAL DEFAULT NULL,
  `O2set` REAL DEFAULT NULL,
  `CO2` REAL DEFAULT NULL,
  `F` REAL DEFAULT NULL,
  `V` REAL DEFAULT NULL,
  `Ps` REAL DEFAULT NULL,
  `Pd` REAL DEFAULT NULL
);

CREATE TABLE IF NOT EXISTS `tgroup` (
  `NGroup` INTEGER PRIMARY KEY,
  `Name` TEXT DEFAULT NULL
);

CREATE TABLE IF NOT EXISTS `tpatien` (
  `Nmedcard` INTEGER PRIMARY KEY,
  `Surname` TEXT DEFAULT NULL,
  `FirstName` TEXT DEFAULT NULL,
  `Patronymic` TEXT DEFAULT NULL,
  `DataOfBirth` TEXT DEFAULT NULL,
  `Sex` TEXT DEFAULT NULL,
  `Height` INTEGER DEFAULT NULL,
  `Weight` INTEGER DEFAULT NULL,
  `Address` TEXT DEFAULT NULL,
  `PhoneN` TEXT DEFAULT NULL,
  `Email` TEXT DEFAULT NULL,
  `Diagnosis` TEXT DEFAULT NULL,
  `NSessionDiagn` INTEGER DEFAULT NULL,
  `NSessionTreat` INTEGER DEFAULT NULL,
  `NGroup` INTEGER DEFAULT NULL
);

CREATE TABLE IF NOT EXISTS `tsession` (
  `Nmedcard` INTEGER DEFAULT NULL,
  `Namesession` TEXT DEFAULT NULL,
  `DateOfSession` TEXT DEFAULT NULL,
  `DurationOfSession` INTEGER DEFAULT NULL,
  `DurationOfPause` INTEGER DEFAULT NULL,
  `IdDataSession` INTEGER PRIMARY KEY,
  `Note` TEXT DEFAULT NULL,
  `SessionPatternNum` INTEGER DEFAULT NULL
);





	
	




